	const [name, setName] = useState('Adam')

	useEffect(() => {
		console.log('Hello Worold')
		fetch('http://localhost:3000/transactions')
			.then(response => response.json())
	      	.then(trans => {setTransactions(trans)});
	},[])

  return (
  	<div className="App">
    	<div className="pa4">
	      <Navigation/>
	      <Greeting name={name} />
	      <InputTransaction
	      />
	    </div>
      <div className="flex flex-wrap no-wrap">
      	<div className="outline w-25 pa3 mr2 ml2">
	      	<UpcomingBills/>
	      </div>
	      <div className="outline w-70 pa3 mr2">
		      <Transactions/>
		    </div>
      </div>
    </div>
  );
}

export default App;
